import React from 'react'
import styled from 'styled-components'
import bg from '../../images/books-bg.svg'

const Container = styled.div`
    position: absolute;
    width: 28%;
    top: 70px;
    right: 100px;
    background: blue;
    height: 360px;
    @media (max-width: 1180px) {
        width: 28%;
        top: 62px;
        right: 40px;
        height: 290px;
    }
    @media (max-width: 960px) {
        width: 28%;
        top: 60px;
        right: 90px;
        height: 294px;
    }
    @media (max-width: 800px) {
        position: absolute;
        right: 16%;
        width: 68%;
        height: auto;
        margin: 0;
        margin-top: 28px;
    }
    @media (max-width: 516px) {
        margin-top: 20px;
    }
`

const BgImg = styled.img`
    margin: 0;
`

const Books = () => {
  return (
    <Container>
        <BgImg src={bg}></BgImg>
    </Container>
  )
}

export default Books
